import { __decorate } from "tslib";
import { Component } from '@angular/core';
let NavbarPacientComponent = class NavbarPacientComponent {
    constructor(token, userService, notifyService, router) {
        this.token = token;
        this.userService = userService;
        this.notifyService = notifyService;
        this.router = router;
    }
    showToasterSuccess() {
        this.notifyService.showSuccess("Cont sters cu succes !!");
    }
    ngOnInit() {
        this.currentUser = this.token.getUser();
    }
    clickMethod() {
        if (confirm("Sunteți sigur că doriți să ștergeți contul?")) {
            this.userService.deleteUser(this.currentUser.email).subscribe({
                next: async () => {
                    this.showToasterSuccess();
                    await new Promise(f => setTimeout(f, 2000));
                    this.router.navigate(['/login']);
                },
                error: (error) => {
                    alert(error.message);
                }
            });
        }
    }
};
NavbarPacientComponent = __decorate([
    Component({
        selector: 'app-navbar',
        templateUrl: './navbar.component.html',
        styleUrls: ['./navbar.component.css']
    })
], NavbarPacientComponent);
export { NavbarPacientComponent };
